import logo from './logo.svg';
import './App.css';
import React, { useEffect, useState } from 'react';
import axios from 'axios'
import './components/style.css'
// import components needed
import Header from './components/header'
import Navbar from './components/navbar';
import Addfood from './components/addfood';
import Findfood from './components/findfood';
import Seefood from './components/seefood';

// import router libraries from react-router
import {
  Routes,
  Route,
} from "react-router-dom";





function App() {

  //using use state to create JS object
  const [data, setfooddata] = useState({
    foodname: "",
    ishot: "",
  });

  useEffect(() =>{
    //using fetch to grab from flask server
    fetch('/food').then(
      (res) =>res.json()
      .then(
          (data) =>
          {
          console.log(data);
          setfooddata(data);
    })
    );

  }, []);



   //creating function to handle search food btn
   const clickFindFood = () => {
    console.log('the find food btn was clicked');
    fetch('/food')
    .then((res) => {
      const data =  res.json();
      return data

    })
    .then((data) => {
      const foodput = document.querySelector("#givenfooditem")

      console.log('the food is...', data.food)      
      foodput.innerHTML = data.food;

    })

    .catch((error) => {
      console.error('The fetch operation fucked up', error);
    });
  }


  return (
    <div>
      <Header></Header>

      <main>
        <Navbar></Navbar>
        <section>
          <Routes>
            <Route exact path="/" element={<Findfood />} />

            <Route exact path="/findfood" element={<Findfood />} />

            <Route exact path="/addfood" element={<Addfood />} />

            <Route exact path="/seefood" element={<Seefood />} />


          </Routes>

        </section>


      </main>
    </div>
  );
}

export default App;
